type Human = {
  name: string
  age: number
  location: string,
  music: string[],
  isCool: boolean
}

let Jakob: Human = {
  name: "Jakob",
  age: 25,
  location: "Stockholm",
  music: ["Grunge", "Indie", "Dubstep"],
  isCool: true,
}

let Bryan: Human = {
  name: "Bryan",
  age: 25,
  location: "Stockholm",
  music: ["Grunge", "Indie", "Dubstep"],
  isCool: true,
}

function sum(a: number, b: number): number {
  return a + b;
}




